import React, { useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import ArrowUpwardIcon from '@mui/icons-material/ArrowUpward';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
const App = () => {

    const [num, setNum] = useState(0);


    const drama = () => {
        setNum(num + 1);
        // alert("bakchodi na chacha");
    }

    const dramatwo = () => {
        setNum((prev) => {
            if (prev === 0) {
              alert("bakchodi na chacha");
              return 0;
            }
            else {
                return prev - 1;
            }
        });
    }

    return (
        <React.Fragment>
        <div className="container-sm ">
            <h1>{num}</h1>
            <button type="button" className="btn btn-success" onClick={drama}><ArrowUpwardIcon/>Incre</button>
            <button type="button" className="btn btn-danger" onClick={dramatwo}><ArrowDownwardIcon/>Decre</button>
            </div>
        </React.Fragment>
    )
}
export default App;
